em style=\"margin: 0px 0px 0px 10px; padding: 0px; font-family: &quot;times new roman&quot;;\">/Washing mark</em></p><p><span style=\"margin: 0px; padding: 0px; width: 790px;\"><img src=\"https://img.alicdn.com/imgextra/i3/581746910/TB2tMo3bVXXXXb1XXXXXXXXXXXX-581746910.jpg\" class=\"img-ks-lazyload\"/><span style=\"margin: 0px; padding: 0px;\"><img src=\"https://img.alicdn.com/imgextra/i4/581746910/TB2a0iimHxmpuFjSZJiXXXauVXa-581746910.jpg\" class=\"img-ks-lazyload\"/></span><span style=\"margin: 0px; padding: 0px;\"><img src=\"https://img.alicdn.com/imgextra/i1/581746910/TB2XFifmNBmpuFjSZFDXXXD8pXa-581746910.jpg\" class=\"img-ks-lazyload\"/></span></span></p><p><img width=\"790\" src=\"https://img.alicdn.com/tfs/TB1M8UgPVXXXXbIXFXXXXXXXXXX-710-137.png\" alt=\"价格说明\"/></p><p><span style=\"text-decoration:line-through;\"><strong style=\"margin: 0px; padding: 0px;\"></strong></span></p><p><span style=\"margin: 0px; padding: 0px; transition: all 0.3s;\"></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 1.4;\"><img alt=\"\" src=\"https://gdp.alicdn.com/imgextra/i3/581746910/TB2m_n4idhvOuFjSZFBXXcZgFXa-581746910.jpg\"/></p>', '40');
